function removeDisclaimerCloseButton(){var e=document.querySelector("#disclaimer-link"),o=document.querySelector("button.close");e.addEventListener("click",function(){o.parentElement.removeChild(o)})}function addDOBs(){for(var e=document.querySelector("#dob"),o=2006;o>1918;o--){var t=document.createElement("option");t.textContent=o,e.appendChild(t)}}window.onload=function(){addDOBs(),removeDisclaimerCloseButton()}();